        private void BBlast_MouseClick(object sender, MouseEventArgs e)
        {
            if (_state == BBlastState.Intro)
            {
                Developers? dev = _introScreen.GetSelectedDeveloper(mouseX, mouseY);
                if (dev != null)
                {
                    StartGame(dev.Value);
                }
            }
            else if (_state == BBlastState.Game || _state == BBlastState.FeatureTeam)
            {
                if (_busters.ContainsKey(_busterSelector.SelectedBuster))
                {
                    if (_busters[_busterSelector.SelectedBuster].CanFire())
                    {
                        _busters[_busterSelector.SelectedBuster].Fire(e.Location.X, e.Location.Y);
                        _scoreCard.CurrentScore.ShotsFired[_busterSelector.SelectedBuster] = _scoreCard.CurrentScore.ShotsFired[_busterSelector.SelectedBuster] + 1;
                    }
                }
            }
            else if (_state == BBlastState.ScoreCard || _state == BBlastState.FeatureTeamScore)
            {
                _scoreCard.OnMouseClick();
            }
        }

