        #region Draw Logic

        private void Draw(object sender, PaintEventArgs e)
        {
            if (_state == BBlastState.Intro)
            {
                _introScreen.Draw(e.Graphics, mouseX, mouseY);
                return;
            }

            if (_state == BBlastState.LevelDisplay || _state == BBlastState.FeatureTeamDisplay)
            {
                _levelDisplayer.Draw(e.Graphics);
            }
            else if (_state == BBlastState.ScoreCard || _state == BBlastState.FeatureTeamScore)
            {
                _scoreCard.Draw(e.Graphics);
            }
            else if (_state == BBlastState.Game)
            {
                string s = string.Format("Sprint {0}      Points: {1} / {2}       BB Rating: {3:N2}       Salary: {4:C2}",
                    _spawnManager.CurrentLevel,
                    _spawnManager.BugsInLevel - _spawnManager.BugsLeftInLevel,
                    _spawnManager.BugsInLevel,
                    _scoreCard.BBRating,
                    _scoreCard.TotalScore);

                e.Graphics.DrawString(s, BBFonts.ScoreFont, Brushes.Black, 260, 10);
            }
            else if (_state == BBlastState.FeatureTeam)
            {
                string s = string.Format("Time remaining: 0:{0:N1}       Bugs fixed: {1}", _featureTeamTimeRemaining, _scoreCard.CurrentScore.TotalBugsKilled);
                e.Graphics.DrawString(s, BBFonts.ScoreFont, Brushes.Black, 512.0f, 10.0f, BBFonts.CenteredFormat);
            }

            //Draw the black holes before anything else so they appear behind everything
            (_busters[BusterTypes.BlackHole] as BlackHoleBuster).DrawBlackHoles(e.Graphics);

            foreach (Projectile proj in _projectiles)
            {
                proj.Draw(e.Graphics);
            }
            foreach (Flyer flyer in _flyers)
            {
                flyer.Draw(e.Graphics);
            }

            _dealPlanning.Draw(e.Graphics);
            _busterSelector.Draw(e.Graphics);

            //Draw the selected developer
            if (_selectedDeveloper == Developers.Rob)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Rob, new Point(BBlast.DeveloperX, BBlast.DeveloperY));
            if (_selectedDeveloper == Developers.Brad)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Brad, new Point(BBlast.DeveloperX, BBlast.DeveloperY));
            if (_selectedDeveloper == Developers.Dustin)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Dustin, new Point(BBlast.DeveloperX, BBlast.DeveloperY));
            if (_selectedDeveloper == Developers.Mitch)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Mitch, new Point(BBlast.DeveloperX, BBlast.DeveloperY));
            if (_selectedDeveloper == Developers.Sathya)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Sathya, new Point(BBlast.DeveloperX, BBlast.DeveloperY));
            if (_selectedDeveloper == Developers.Avin)
                e.Graphics.DrawImage(GraphicsHolder.Instance.Avin, new Point(BBlast.DeveloperX, BBlast.DeveloperY));

            //Draw the busters
            if (_busters.ContainsKey(_busterSelector.SelectedBuster))
            {
                _busters[_busterSelector.SelectedBuster].Draw(e.Graphics);
            }

            _textDisplayer.Draw(e.Graphics);
        }
