        #region Update Logic

        private void Update(object sender, EventArgs e)
        {
            float dt = (float)(BBUtils.CurTime() - _lastUpdateTime) / 1000.0F;
            _timeInState += dt;
            _lastUpdateTime = BBUtils.CurTime();

            //Clone the objects that we need to update in case the original collections
            //are modified while we are iterating over them.
            List<Projectile> pClone = new List<Projectile>(_projectiles);
            List<Flyer> fClone = new List<Flyer>(_flyers);

            if (_state == BBlastState.Intro)
            {
            }
            else if (_state == BBlastState.LevelDisplay)
            {
                DoMoves(pClone, fClone);
                _levelDisplayer.Update(dt);
                _textDisplayer.Update();
                UpdateBusters();

                if (!_levelDisplayer.IsActive)
                {
                    EnterState(BBlastState.Game);
                }
            }
            else if (_state == BBlastState.FeatureTeamDisplay)
            {
                DoMoves(pClone, fClone);
                _levelDisplayer.Update(dt);
                UpdateBusters();

                if (!_levelDisplayer.IsActive)
                {
                    EnterState(BBlastState.FeatureTeam);
                }
            }
            else if (_state == BBlastState.ScoreCard)
            {
                DoMoves(pClone, fClone);
                UpdateBusters();
                _scoreCard.Update(dt);
                _textDisplayer.Update();

                if (!_scoreCard.IsActive)
                {
                    if (_spawnManager.CurrentLevel == 1 || _spawnManager.CurrentLevel % 5 == 0)
                    {
                        EnterState(BBlastState.FeatureTeamDisplay);
                    }
                    else
                    {
                        EnterState(BBlastState.LevelDisplay);
                    }
                }
            }
            else if (_state == BBlastState.FeatureTeamScore)
            {
                DoMoves(pClone, fClone);
                UpdateBusters();
                _scoreCard.Update(dt);
                _textDisplayer.Update();

                if (!_scoreCard.IsActive)
                {
                    EnterState(BBlastState.LevelDisplay);
                }
            }
            else if (_state == BBlastState.Game || _state == BBlastState.FeatureTeam)
            {
                DoCollision(pClone, fClone);
                DoMoves(pClone, fClone);

                _dealPlanning.Update();
                _busterSelector.Update();
                _textDisplayer.Update();
                UpdateBusters();

                if (_state == BBlastState.FeatureTeam)
                {
                    _featureTeamTimeRemaining -= dt;
                    if (_featureTeamTimeRemaining < 0.0 || _scoreCard.CurrentScore.TotalBugsKilled >= FeatureTeamBugsToFix)
                    {
                        _featureTeamTimeRemaining = 0.0;
                        EnterState(BBlastState.FeatureTeamScore);
                    }
                }

                foreach (KeyValuePair<Keys, bool> kvp in _keyState)
                {
                    if ((kvp.Key == Keys.Left || kvp.Key == Keys.A) && kvp.Value)
                    {
                        DeveloperX = Math.Max(DeveloperX - Developer_Speed, Convert.ToInt32(DealPlanning.Width));
                    }
                    else if ((kvp.Key == Keys.Right || kvp.Key == Keys.D) && kvp.Value)
                    {
                        DeveloperX = Math.Min(DeveloperX + Developer_Speed, this.Width - GraphicsHolder.Instance.Rob.Width);
                    }
                }

                // spawn the bugs
                _spawnManager.Update();
                if (_spawnManager.BugsLeftInLevel <= 0)
                {
                    if (_state == BBlastState.FeatureTeam)
                    {
                        EnterState(BBlastState.FeatureTeamScore);
                    }
                    else if (_state == BBlastState.Game)
                    {
                        EnterState(BBlastState.ScoreCard);
                    }
                }
            }

            DoCleanup();

            //Invalidate the screen to force the paint event to be called for this frame.
            Invalidate();
        }

        private void StartGame(Developers developer)
        {
            _selectedDeveloper = developer;
            EnterState(BBlastState.LevelDisplay);
        }

        /// <summary>
        /// Handles state transition logic.
        /// 
        /// States go Intro->LevelDisplayer->Game->Scorecard->LevelDisplayer->Game etc.
        /// </summary>
        /// <param name="newState"></param>
        private void EnterState(BBlastState newState)
        {
            _state = newState;
            _timeInState = 0.0;

            if (newState == BBlastState.Game)
            {
                _lastUpdateTime = BBUtils.CurTime();
                _scoreCard.Reset();
            }
            else if (newState == BBlastState.ScoreCard)
            {
                KillAllBugs();
                _scoreCard.ShowScoreCard();
            }
            else if (newState == BBlastState.LevelDisplay)
            {
                _spawnManager.StartNextLevel();
                _levelDisplayer.ShowNextLevel();
            }
            else if (newState == BBlastState.FeatureTeamDisplay)
            {
                _levelDisplayer.StartFeatureTeam();
            }
            else if (newState == BBlastState.FeatureTeam)
            {
                _lastUpdateTime = BBUtils.CurTime();
                _spawnManager.StartFeatureTeam();
                _scoreCard.Reset();
                _featureTeamTimeRemaining = FEATURE_TEAM_DURATION;
            }
            else if (newState == BBlastState.FeatureTeamScore)
            {
                FeatureTeamBugsToFix += 10;
                KillAllBugs();
                _scoreCard.ShowScoreCard();
            }
        }

        private void DoCollision(ICollection<Projectile> projectiles, ICollection<Flyer> flyers)
        {
            foreach (Projectile proj in projectiles)
            {
                foreach (Flyer flyer in flyers)
                {
                    if (proj.DidCollide(flyer))
                    {
                        proj.HandleCollision(flyer);
                    }
                }
            }
        }

        private void UpdateBusters()
        {
            foreach (Buster buster in _busters.Values)
            {
                buster.Update();
            }
        }

        private void DoMoves(ICollection<Projectile> projectiles, ICollection<Flyer> flyers)
        {
            foreach (Projectile proj in projectiles)
            {
                proj.Move();
            }
            foreach (Flyer flyer in flyers)
            {
                flyer.Move();
            }
        }

        private void DoCleanup()
        {
            List<Flyer> deadFlyers = new List<Flyer>();
            foreach (Flyer flyer in _flyers)
            {
                if (!flyer.IsAlive)
                    deadFlyers.Add(flyer);
            }
            foreach (Flyer deadFlyer in deadFlyers)
            {
                _flyers.Remove(deadFlyer);
            }

            List<Projectile> deadProjectiles = new List<Projectile>();
            foreach (Projectile proj in _projectiles)
            {
                if (!proj.IsAlive)
                    deadProjectiles.Add(proj);
            }
            foreach (Projectile deadProjectile in deadProjectiles)
            {
                _projectiles.Remove(deadProjectile);
            }
        }

        private void KillAllBugs()
        {
            foreach (Flyer flyer in _flyers)
            {
                flyer.Dy = 10;
                flyer.Ay = 10;
            }
        }

        #endregion

    }
