    #region IntroScreen
    public class IntroScreen
    {
        private BBlast _blast;
        private int _currentBug = 0;
        private long _lastBugSpawn = 0;
        private List<ScrollingBug> _bugs = new List<ScrollingBug>();
        private List<Developer> _developers = new List<Developer>();

        public IntroScreen(BBlast blast)
        {
            _blast = blast;

            _developers.Add(new Developer(Developers.Rob, 220, 570));
            _developers.Add(new Developer(Developers.Brad, 320, 570));
            _developers.Add(new Developer(Developers.Dustin, 420, 570));
            _developers.Add(new Developer(Developers.Mitch, 520, 570));
            _developers.Add(new Developer(Developers.Sathya, 620, 570));
            _developers.Add(new Developer(Developers.Avin, 720, 570));
        }

        public void Draw(Graphics g, int mouseX, int mouseY)
        {
            float centerX = (float)_blast.Width / 2.0F;
            g.DrawString("Welcome to Bug Blast!", BBFonts.LevelFont, Brushes.Black, centerX, 10.0F, BBFonts.CenteredFormat);
            g.DrawString("By Rob and Brad", BBFonts.SmallFont, Brushes.Black, centerX, 80.0F, BBFonts.CenteredFormat);

            g.DrawString("How To Play", BBFonts.InstructionsFont, Brushes.Black, centerX, 110.0F, BBFonts.CenteredFormat);

            string howToPlay =
@"Live a day in the life of a Deal Planning developer by protecting our beloved 
application from the relentless onslaught of bugs appearing from the right side 
of the screen. You are armed with nothing but your wits and an arsenal of color
coded Bug Blasters. Each bug is also color coded and can only be destroyed with 
the correctly colored Bug Blaster. Every time a bug reaches Deal Planning, the 
application will be damaged. As if bugs were not enough, our application is also 
under attack from the dastardly Sheltoon. Deadlier than any bug, if you allow a 
Sheltoon to reach Deal Planning who knows what will happen!";

            g.DrawString(howToPlay, BBFonts.HowToPlayFont, Brushes.Black, centerX, 160.0F, BBFonts.CenteredFormat);

            g.DrawString("Controls", BBFonts.InstructionsFont, Brushes.Black, centerX, 380.0F, BBFonts.CenteredFormat);

            g.DrawString("Mouse click - Fire your bug buster", BBFonts.HowToPlayFont, Brushes.Black, 160, 430);
            g.DrawString("Left / Right - Move your developer", BBFonts.HowToPlayFont, Brushes.Black, 550, 430);

            g.DrawString("Mouse wheel - Select your bug buster", BBFonts.HowToPlayFont, Brushes.Black, 512.0f, 460.0f, BBFonts.CenteredFormat);
            //g.DrawString("Mouse wheel - Select your bug buster", BBFonts.HowToPlayFont, Brushes.Black, 160, 460);
            //g.DrawString("1-5 - Select a specific bug buster", BBFonts.HowToPlayFont, Brushes.Black, 550, 460);

            g.DrawString("Select a Developer to Begin", BBFonts.InstructionsFont, Brushes.Black, centerX, 510.0F, BBFonts.CenteredFormat);

            DrawBugs(g);

            foreach (Developer dev in _developers)
            {
                dev.Draw(g, mouseX, mouseY);
            }
        }

        public Developers? GetSelectedDeveloper(int mouseX, int mouseY)
        {
            foreach (Developer dev in _developers)
            {
                if (dev.IsSelected(mouseX, mouseY))
                    return dev.DeveloperType;
            }
            return null;
        }

        private void DrawBugs(Graphics g)
        {
            if (BBUtils.CurTime() - _lastBugSpawn > 1200)
            {
                _lastBugSpawn = BBUtils.CurTime();

                Bitmap bugBm = null;

                if (_currentBug == 0)
                    bugBm = GraphicsHolder.Instance.RedBug;
                else if (_currentBug == 1)
                    bugBm = GraphicsHolder.Instance.GreenBug;
                else if (_currentBug == 2)
                    bugBm = GraphicsHolder.Instance.BlueBug;
                else if (_currentBug == 3)
                    bugBm = GraphicsHolder.Instance.BlackBug;
                else if (_currentBug == 4)
                    bugBm = GraphicsHolder.Instance.YellowBug;

                _currentBug++;
                if (_currentBug > 4)
                    _currentBug = 0;

                _bugs.Add(new ScrollingBug(bugBm, 40, -50, 6));
                _bugs.Add(new ScrollingBug(bugBm, _blast.Width - 120, _blast.Height, -6));
            }

            List<ScrollingBug> bugsToRemove = new List<ScrollingBug>();
            foreach (ScrollingBug bug in _bugs)
            {
                bug.Y = bug.Y + bug.Dy;
                if ((bug.Dy < 0 && bug.Y < -50) || (bug.Dy > 0 && bug.Y > _blast.Height + 50))
                    bugsToRemove.Add(bug);
                else
                    g.DrawImage(bug.Image, new Point(bug.X, bug.Y));
            }

            foreach (ScrollingBug bug in bugsToRemove)
            {
                _bugs.Remove(bug);
            }
        }

        private class ScrollingBug
        {
            public Image Image;
            public int X, Y;
            public int Dy;

            public ScrollingBug(Image image, int x, int y, int dy)
            {
                Image = image;
                X = x;
                Y = y;
                Dy = dy;
            }
        }

        private class Developer
        {
            private Developers _developer;
            private int _x, _y;

            public Developer(Developers developer, int x, int y)
            {
                _developer = developer;
                _x = x;
                _y = y;
            }

            public void Draw(Graphics g, int mouseX, int mouseY)
            {
                if (IsSelected(mouseX, mouseY))
                {
                    g.DrawImage(GraphicsHolder.Instance.DeveloperSelector, new Point(_x - 4, _y - 4));
                }

                if (_developer == Developers.Rob)
                    g.DrawImage(GraphicsHolder.Instance.Rob, new Point(_x, _y));
                if (_developer == Developers.Brad)
                    g.DrawImage(GraphicsHolder.Instance.Brad, new Point(_x, _y));
                if (_developer == Developers.Dustin)
                    g.DrawImage(GraphicsHolder.Instance.Dustin, new Point(_x, _y));
                if (_developer == Developers.Mitch)
                    g.DrawImage(GraphicsHolder.Instance.Mitch, new Point(_x, _y));
                if (_developer == Developers.Sathya)
                    g.DrawImage(GraphicsHolder.Instance.Sathya, new Point(_x, _y));
                if (_developer == Developers.Avin)
                    g.DrawImage(GraphicsHolder.Instance.Avin, new Point(_x, _y));
            }

            public Developers DeveloperType
            {
                get { return _developer; }
            }

            public bool IsSelected(int mouseX, int mouseY)
            {
                return mouseX >= _x && mouseX <= _x + 64 &&
                    mouseY >= _y && mouseY <= _y + 64;
            }
        }
    }
