    #region Entity
    public class Entity
    {
        #region Data Members
        protected Bitmap _image;
        protected EntityType _type;
        protected bool _isAlive = true;
        protected double _scale = 1.0;
        protected BBlast _blast;
        public double X, Y, Dx, Dy, Ax, Ay, Width, Height;
        #endregion

        #region Constructor
        public Entity(BBlast blast, Bitmap image, double x, double y, double dx, double dy, double ax, double ay)
        {
            _blast = blast;
            _image = image;
            X = x;
            Y = y;
            Dx = dx;
            Dy = dy;
            Ax = ax;
            Ay = ay;
            Width = (double)image.Width;
            Height = (double)image.Height;
        }
        #endregion

        #region Properties
        public double Scale
        {
            get { return _scale; }
            set { _scale = value; }
        }

        public Bitmap Image
        {
            get { return _image; }
            set { _image = value; }
        }

        public EntityType Type
        {
            get { return _type; }
        }

        public bool IsAlive
        {
            get { return _isAlive; }
            set
            {
                if (_type == EntityType.Flyer && value == false)
                {
                    _blast.SpawnManager.BugsLeftInLevel--;
                }
                _isAlive = value;
            }
        }
        #endregion

        #region Public Methods

        public void Stop()
        {
            Dx = Dy = Ax = Ay = 0.0;
        }

        public virtual void Move()
        {
            Dx += Ax;
            Dy += Ay;

            X += Dx;
            Y += Dy;

            if (X < -100 ||
                X > _blast.Width + 100 ||
                Y < -100 ||
                Y > _blast.Height + 100)
            {
                IsAlive = false;
            }
        }

        public virtual bool DidCollide(Entity ent)
        {
            if (!_isAlive || !ent.IsAlive) return false;

            double thisWidth = Width * _scale * 0.95;
            double thisHeight = Width * _scale * 0.95;
            double entWidth = ent.Width * ent.Scale * 0.95;
            double entHeight = ent.Height * ent.Scale * 0.95;

            if (Math.Abs(X - ent.X) > thisWidth / 2.0 + entWidth / 2.0) return false;
            if (Math.Abs(Y - ent.Y) > thisHeight / 2.0 + entHeight / 2.0) return false;
            return true;
        }

        public virtual void Draw(Graphics g)
        {
            if (_isAlive)
            {
                if (Scale == 1.0)
                    g.DrawImage(_image, (int)X, (int)Y);
                else
                    g.DrawImage(_image, (float)X, (float)Y, Convert.ToInt32(Width * _scale), Convert.ToInt32(Height * _scale));
            }
        }
        #endregion
    }
