    #region Project : Entity
    public class Project : Entity
    {
        #region Private Variables

        List<Point> _chunkPoints = new List<Point>();
        List<Entity> _chunks = new List<Entity>();
        private int _numChunkPoints;
        private Rectangle _bounds;
        private Bitmap _chunkMask1;
        private Bitmap _chunkMask2;
        private Bitmap _chunkMask3;

        #endregion

        #region Constructor

        public Project(BBlast blast, Bitmap image, double x, double y, double dx, double dy, double ax, double ay)
            : base(blast, image, x, y, dx, dy, ax, ay)
        {
            InitChunkPoints(100);
            _bounds = new Rectangle(0, 0, image.Width + 1, image.Height);
        }

        #endregion

        #region Properties

        public int Health
        {
            get { return Convert.ToInt32((double)_chunkPoints.Count / (double)_numChunkPoints) * 100; }
        }

        #endregion

        #region Public Methods

        public void ChipOffPiece()
        {
            if (_chunkPoints.Count == 0)
            {
                throw new Exception("You lose!");
            }

            Point p = _chunkPoints[new Random().Next(0, _chunkPoints.Count)];
            Bitmap chunkImage = RemoveChunk(p);
            SpawnChunk(p.X, p.Y, chunkImage);
        }

        public void Update()
        {
            foreach (Entity chunk in _chunks)
            {
                chunk.Move();
            }
        }

        public override void Draw(Graphics g)
        {
            g.FillRectangle(Brushes.Black, _bounds);
            base.Draw(g);

            foreach (Entity chunk in _chunks)
            {
                chunk.Draw(g);
            }
        }

        #endregion

        #region Helper Methods

        /// <summary>
        /// Initializes a grid with a number of points as close as possible to
        /// numChunkPoints.
        /// </summary>
        /// <param name="numChunkPoints"></param>
        private void InitChunkPoints(int numChunkPoints)
        {
            _numChunkPoints = numChunkPoints;

            int w = GraphicsHolder.Instance.DealPlanning.Width;
            int h = GraphicsHolder.Instance.DealPlanning.Height;
            double ratio = (double)w / (double)h;

            int y = Convert.ToInt32(Math.Sqrt((double)numChunkPoints / ratio));
            int x = Convert.ToInt32((double)numChunkPoints / y);

            double xDist = Math.Ceiling(w / (double)x);
            double yDist = Math.Ceiling(h / (double)y);

            int chunkMaskWidth = Convert.ToInt32(xDist * 1.3);
            int chunkMaskHeight = Convert.ToInt32(yDist * 1.3);

            _chunkMask1 = new Bitmap(chunkMaskWidth, chunkMaskHeight);
            Graphics g = Graphics.FromImage(_chunkMask1);
            g.DrawImage(GraphicsHolder.Instance.ChunkMask1, 0, 0, chunkMaskWidth, chunkMaskHeight);
            g.Dispose();

            _chunkMask2 = new Bitmap(chunkMaskWidth, chunkMaskHeight);
            g = Graphics.FromImage(_chunkMask2);
            g.DrawImage(GraphicsHolder.Instance.ChunkMask2, 0, 0, chunkMaskWidth, chunkMaskHeight);
            g.Dispose();

            _chunkMask3 = new Bitmap(chunkMaskWidth, chunkMaskHeight);
            g = Graphics.FromImage(_chunkMask3);
            g.DrawImage(GraphicsHolder.Instance.ChunkMask3, 0, 0, chunkMaskWidth, chunkMaskHeight);
            g.Dispose();

            for (int i = 0; i < x; i++)
            {
                for (int j = 0; j < y; j++)
                {
                    _chunkPoints.Add(new Point(Convert.ToInt32(i * xDist) + Convert.ToInt32(xDist / 2.0), Convert.ToInt32(j * yDist) + Convert.ToInt32(yDist / 2.0)));
                }
            }
        }

        /// <summary>
        /// Chips off a chunk of DealPlanning at the given location and returns it as
        /// a bitmap.
        /// </summary>
        /// <param name="p"></param>
        /// <returns></returns>
        private Bitmap RemoveChunk(Point p)
        {
            _chunkPoints.Remove(p);

            int x = 0;
            int y = 0;
            Bitmap mask = ChooseRandomMask();
            Bitmap bm = GraphicsHolder.Instance.CreateEmptyBitmap(mask.Width, mask.Height);

            for (int i = Convert.ToInt32(Math.Floor((double)p.X - (double)mask.Width / 2.0)); i <= Convert.ToInt32(Math.Floor((double)p.X + (double)mask.Width / 2.0)); i++)
            {
                y = 0;
                if (x >= mask.Width)
                    break;

                for (int j = Convert.ToInt32(Math.Floor((double)p.Y - (double)mask.Height / 2.0)); j <= Convert.ToInt32(Math.Floor((double)p.Y + (double)mask.Height / 2.0)); j++)
                {
                    if (y >= mask.Height)
                        break;

                    if (mask.GetPixel(x, y).A != 0 && IsInBounds(i, j))
                    {
                        bm.SetPixel(x, y, GraphicsHolder.Instance.DealPlanning.GetPixel(i, j));
                        _image.SetPixel(i, j, Color.Transparent);
                    }
                    y++;
                }
                x++;
            }

            return bm;
        }

        private bool IsInBounds(Point p)
        {
            return IsInBounds(p.X, p.Y);
        }

        private bool IsInBounds(int x, int y)
        {
            return x > 0 && x < GraphicsHolder.Instance.DealPlanning.Width &&
                   y > 0 && y < GraphicsHolder.Instance.DealPlanning.Height;
        }

        private Bitmap ChooseRandomMask()
        {
            int r = new Random().Next(0, 300000);

            if (r < 100000)
            {
                return _chunkMask1;
            }
            else if (r < 200000)
            {
                return _chunkMask2;
            }
            else
            {
                return _chunkMask3;
            }
        }

        private void SpawnChunk(double x, double y, Bitmap bitmap)
        {
            Random r = new Random();
            _chunks.Add(new Entity(_blast, bitmap, x, y, r.Next(-5, 5), -20.0, 0.0, 4.0));
        }

        #endregion
    }
    #endregion

    #region Projectiles

    #region Star : Projectile : Entity
    public class Star : Projectile
    {
        #region Tweakable Parameters
        private static double _yAccel = 1;
        private static int _explodeRad = 50;
        private static int _numStarsOnExplode = 3;
        private bool _isShrapnel = false;
        #endregion

        #region Constructor
        private Star(BBlast blast, double x, double y, double dx, double dy, double ax, double ay)
            : base(blast, GraphicsHolder.Instance.Star, x, y, dx, dy, ax, ay, BusterTypes.Star)
        {
        }
        #endregion

        #region Static Create
        public static Star MakeStar(BBlast blast, double origX, double origY, double destX, double destY)
        {
            if (destY > origY - 20)
            {
                return null;
            }

            double yVel = (float)(-Math.Sqrt(Math.Abs(2.0 * _yAccel * (destY - (GraphicsHolder.Instance.Star.Height) - origY))));
            double t = Math.Abs(yVel / _yAccel);
            double xVel = (destX - origX) / t;

            Star star = new Star(blast, origX, origY,
                xVel, yVel, 0, _yAccel);

            blast.Projectiles.Add(star);
            return star;
        }
        #endregion

        #region Public Methods
        public override void HandleCollision(Flyer flyer)
        {
            if (flyer.BusterType != _busterType && flyer.BusterType != BusterTypes.Sheltoon)
                return;

            base.HandleCollision(flyer);

            if (flyer.BusterType == BusterTypes.Sheltoon)
                return;

            _isAlive = false;

            if (flyer.BusterType == _busterType)
            {
                for (int i = 0; i < _numStarsOnExplode; i++)
                {
                    Star star = Star.MakeStar(_blast,
                        X, Y,
                        X + _blast.rand.Next(-_explodeRad, _explodeRad),
                        Y - 20.0 - _blast.rand.Next(0, _explodeRad));
                    if (star != null)
                    {
                        star._isShrapnel = true;
                    }
                }
            }
        }

        public override void Move()
        {
            base.Move();
            if (Dy >= 0 && !_isShrapnel)
            {
                _isAlive = false;
                for (int i = 0; i < _numStarsOnExplode; i++)
                {
                    Star star = Star.MakeStar(_blast,
                        X, Y,
                        X + _blast.rand.Next(-_explodeRad, _explodeRad),
                        Y - 20 - _blast.rand.Next(0, _explodeRad));
                    if (star != null)
                    {
                        star._isShrapnel = true;
                    }
                }
            }

        }
        #endregion

    }
    #endregion

    #region Snip : Projectile : Entity
    public class Snip : Projectile
    {
        private static double _speed = 50.0;
        private List<Entity> _leftHalves = new List<Entity>();
        private List<Entity> _rightHalves = new List<Entity>();

        private Snip(BBlast blast, double x, double y, double dx, double dy, double ax, double ay)
            : base(blast, GraphicsHolder.Instance.Snip, x, y, dx, dy, ax, ay, BusterTypes.Snip)
        {
        }

        public static Snip MakeSnip(BBlast blast, double origX, double origY, double destX, double destY)
        {
            if (destY > origY - 20)
            {
                return null;
            }

            destX -= GraphicsHolder.Instance.Snip.Width / 2;
            destY -= GraphicsHolder.Instance.Snip.Height / 2;

            double angle = BBUtils.GetAngleBetween(origX, origY, destX, destY);
            double xVel = Snip._speed * Math.Cos(angle);
            double yVel = Snip._speed * Math.Sin(angle);

            Snip snip = new Snip(blast, origX, origY, xVel, yVel, 0.0, 0.0);

            blast.Projectiles.Add(snip);

            return snip;
        }

        public override void HandleCollision(Flyer flyer)
        {
            if (flyer.BusterType != _busterType && flyer.BusterType != BusterTypes.Sheltoon)
                return;

            base.HandleCollision(flyer);

            if (flyer.BusterType == BusterTypes.Sheltoon)
                return;

            Bitmap leftBm = new Bitmap(flyer.Image.Width, flyer.Image.Height);
            Bitmap rightBm = new Bitmap(flyer.Image.Width, flyer.Image.Height);
            int midPoint = flyer.Image.Width / 2 + 6;

            for (int i = 0; i < flyer.Image.Width; i++)
            {
                for (int j = 0; j < flyer.Image.Height; j++)
                {
                    Color c = flyer.Image.GetPixel(i, j);
                    if (i < midPoint)
                    {
                        leftBm.SetPixel(i, j, c);
                        rightBm.SetPixel(i, j, BBColors.Transparent);
                    }
                    else
                    {
                        leftBm.SetPixel(i, j, BBColors.Transparent);
                        rightBm.SetPixel(i, j, c);
                    }
                }
            }

            _leftHalves.Add(new Entity(_blast, leftBm, flyer.X, flyer.Y, BBUtils.RandomDouble(-4, -1), BBUtils.RandomDouble(5, 8), 0.0, 3.0));
            _rightHalves.Add(new Entity(_blast, rightBm, flyer.X, flyer.Y, BBUtils.RandomDouble(1, 4), BBUtils.RandomDouble(5, 8), 0.0, 3.0));
        }

        public override void Draw(Graphics g)
        {
            base.Draw(g);

            if (_leftHalves.Count > 0)
            {
                foreach (Entity en in _leftHalves)
                {
                    en.Draw(g);
                }
            }
            if (_rightHalves.Count > 0)
            {
                foreach (Entity en in _rightHalves)
                {
                    en.Draw(g);
                }
            }
        }

        public override void Move()
        {
            base.Move();

            if (_leftHalves.Count > 0)
            {
                foreach (Entity en in _leftHalves)
                {
                    en.Move();
                    // if this snip still has any cut flyers falling, keep it alive
                    if (en.IsAlive) IsAlive = true;
                }
            }
            if (_rightHalves.Count > 0)
            {
                foreach (Entity en in _rightHalves)
                {
                    en.Move();
                    // if this snip still has any cut flyers falling, keep it alive
                    if (en.IsAlive) IsAlive = true;
                }
            }
        }
    }
    #endregion

    #region Bubble : Projectile : Entity
    public class Bubble : Projectile
    {
        #region Tweakable Parameters
        private static double _reverseAccelMagnitude = 2.0;
        private static int _finalYVel = -8;
        private IDictionary<Flyer, Object> _caughtFlyers = new Dictionary<Flyer, Object>();
        private List<Flyer> _suctionedFlyers = new List<Flyer>();
        private double _destX;
        private double _destY;
        private bool _floatMode;
        #endregion

        #region Constructor
        private Bubble(BBlast blast, double x, double y, double dx, double dy, double ax, double ay, double destX, double destY)
            : base(blast, GraphicsHolder.Instance.Bubble, x, y, dx, dy, ax, ay, BusterTypes.Bubble)
        {
            _destX = destX;
            _destY = destY;
        }
        #endregion

        #region Static Create
        public static Bubble MakeBubble(BBlast blast, double origX, double origY, double destX, double destY)
        {
            if (destY > origY - 20)
            {
                return null;
            }
            destX -= GraphicsHolder.Instance.Bubble.Width / 2;
            destY -= GraphicsHolder.Instance.Bubble.Height / 2;
            double xPosDiff = destX - origX;
            double yPosDiff = destY - origY;

            double angle = BBUtils.GetAngleBetween(origX, origY, destX, destY);

            double xAccel = -Bubble._reverseAccelMagnitude * Math.Cos(angle);
            double yAccel = -Bubble._reverseAccelMagnitude * Math.Sin(angle);

            double initXVel = Math.Sqrt(Math.Abs(2.0 * xAccel * xPosDiff));
            if (destX < origX) initXVel *= -1.0;
            double initYVel = -Math.Sqrt(Math.Abs((_finalYVel * _finalYVel) - 2.0 * yAccel * yPosDiff));

            Bubble bubble = new Bubble(blast, origX, origY,
                initXVel, initYVel,
                xAccel, yAccel, destX, destY);

            blast.Projectiles.Add(bubble);
            return bubble;
        }
        #endregion

        #region Public Methods
        public override void HandleCollision(Flyer flyer)
        {
            base.HandleCollision(flyer);

            //Suck Blue flyers into the bubble
            if (flyer.BusterType == BusterTypes.Bubble && !_caughtFlyers.ContainsKey(flyer))
            {
                flyer.Stop();
                _suctionedFlyers.Add(flyer);
            }
        }

        public override void Move()
        {
            double prevDistance = BBUtils.Distance(X, Y, _destX, _destY);
            base.Move();

            // If we've gotten farther away from the target, go into float mode
            if (_floatMode == false && BBUtils.Distance(X, Y, _destX, _destY) >= prevDistance)
            {
                _floatMode = true;
            }

            if (_floatMode)
            {
                Ax = Ay = 0.0;
                Dx = 0.0;
                Dy = _finalYVel;
            }
            foreach (KeyValuePair<Flyer, Object> flyer in _caughtFlyers)
            {
                flyer.Key.X = X + ((double)(_image.Width - (flyer.Key.Image.Width * flyer.Key.Scale)) / 2.0);
                flyer.Key.Y = Y + ((double)(_image.Height - (flyer.Key.Image.Height * flyer.Key.Scale)) / 2.0);
            }

            List<Flyer> caughtFlyers = new List<Flyer>();
            foreach (Flyer flyer in _suctionedFlyers)
            {
                double angle = BBUtils.GetAngleBetween(flyer.X, flyer.Y, X, Y);
                double speed = 15;

                flyer.X += speed * Math.Cos(angle);
                flyer.Y += speed * Math.Sin(angle);

                double dist = BBUtils.Distance(flyer.X, flyer.Y, X, Y);

                flyer.Scale = ((double)dist) / (3.0 * _image.Width);
                if (flyer.Scale < 0.3) flyer.Scale = 0.3;

                if (dist < _image.Width / 2)
                {
                    caughtFlyers.Add(flyer);
                }
            }

            foreach (Flyer flyer in caughtFlyers)
            {
                flyer.X = X + ((double)(_image.Width - (flyer.Image.Width * flyer.Scale)) / 2.0);
                flyer.Y = Y + ((double)(_image.Height - (flyer.Image.Height * flyer.Scale)) / 2.0);
                flyer.Dx = flyer.Dy = 0.0;
                _suctionedFlyers.Remove(flyer);
                _caughtFlyers[flyer] = null;
            }

            // If we have gone off the screen, kill the caught flyers
            if (Y < 0 - GraphicsHolder.Instance.Bubble.Height)
            {
                foreach (Flyer fly in _caughtFlyers.Keys)
                {
                    if (fly.IsAlive)
                    {
                        fly.Kill();
                    }
                }
            }

        }

        public override void Draw(Graphics g)
        {
            base.Draw(g);
        }
        #endregion

    }
    #endregion

    #region AcidBall : Projectile : Entity
    public class AcidBall : Projectile
    {
        public static double SPEED = 40.0;
        public static int ACID_PARTICLE_DIAMETER = 4;
        private List<Entity> _acidParticles = new List<Entity>();
        private Dictionary<Flyer, BBPoint> _decayLoc = new Dictionary<Flyer, BBPoint>();


        public AcidBall(BBlast blast, double x, double y, double dx, double dy, double ax, double ay)
            : base(blast, GraphicsHolder.Instance.AcidBall, x, y, dx, dy, ax, ay, BusterTypes.Acid)
        {
        }

        public override void HandleCollision(Flyer flyer)
        {
            if (flyer.BusterType != _busterType && flyer.BusterType != BusterTypes.Sheltoon || flyer.IsBeingAcidified)
                return;

            base.HandleCollision(flyer);

            if (flyer.BusterType == BusterTypes.Sheltoon)
                return;

            flyer.Dx *= 0.25;
            flyer.IsBeingAcidified = true;
            flyer.Image = BBUtils.CloneBitmap(flyer.Image);
            _decayLoc.Add(flyer, new BBPoint(0, 0));
        }

        public override void Move()
        {
            base.Move();

            foreach (Flyer flyer in _decayLoc.Keys)
            {
                if (flyer.IsAlive)
                {
                    _isAlive = true;
                    for (int i = 0; i < 3; i++)
                    {
                        Entity acidParticle = CreateAcidParticle(flyer);
                        if (acidParticle == null)
                        {
                            flyer.Kill();
                            break;
                        }
                        else
                        {
                            _acidParticles.Add(acidParticle);
                        }
                    }
                }
            }

            foreach (Entity acidParticle in _acidParticles)
            {
                acidParticle.Move();
            }
        }

        public override void Draw(Graphics g)
        {
            base.Draw(g);

            foreach (Entity acidParticle in _acidParticles)
            {
                acidParticle.Draw(g);
            }
        }

        public static AcidBall MakeAcidBall(BBlast blast, double origX, double origY, double destX, double destY)
        {
            if (destY > origY - 20)
            {
                return null;
            }

            destX -= GraphicsHolder.Instance.AcidBall.Width / 2;
            destY -= GraphicsHolder.Instance.AcidBall.Height / 2;

            double angle = BBUtils.GetAngleBetween(origX, origY, destX, destY);
            double xVel = AcidBall.SPEED * Math.Cos(angle);
            double yVel = AcidBall.SPEED * Math.Sin(angle);

            AcidBall acidBall = new AcidBall(blast, origX, origY, xVel, yVel, 0.0, 0.0);

            blast.Projectiles.Add(acidBall);

            return acidBall;
        }

        private Entity CreateAcidParticle(Flyer flyer)
        {
            Bitmap bm = new Bitmap(ACID_PARTICLE_DIAMETER, ACID_PARTICLE_DIAMETER);
            bool nonTransparentPixelFound = false;

            do
            {
                for (int i = 0; i < ACID_PARTICLE_DIAMETER; i++)
                {
                    for (int j = 0; j < ACID_PARTICLE_DIAMETER; j++)
                    {
                        int x = _decayLoc[flyer].X + i;
                        int y = _decayLoc[flyer].Y + j;

                        if (x >= flyer.Image.Width || x < 0 || y >= flyer.Image.Height || y < 0)
                            continue;

                        Color c = flyer.Image.GetPixel(x, y);

                        if (c != BBColors.Transparent)
                            nonTransparentPixelFound = true;

                        bm.SetPixel(i, j, c);
                        flyer.Image.SetPixel(x, y, BBColors.Transparent);
                    }
                }

                _decayLoc[flyer].X += ACID_PARTICLE_DIAMETER;
                if (_decayLoc[flyer].X >= flyer.Image.Width)
                {
                    _decayLoc[flyer].X = 0;
                    _decayLoc[flyer].Y += ACID_PARTICLE_DIAMETER;
                    if (_decayLoc[flyer].Y >= flyer.Image.Height)
                        return null;
                }
            } while (!nonTransparentPixelFound);


            double dy = BBUtils.RandomDouble(1.5, 2.5);
            double ay = BBUtils.RandomDouble(0.6, 1.2);
            Entity acidParticle = new Entity(_blast, bm, flyer.X + _decayLoc[flyer].X, flyer.Y + _decayLoc[flyer].Y, 0.0, dy, 0.0, ay);
            return acidParticle;
        }
    }
