    #region Busters

    #region Buster
    public class Buster
    {
        #region Data Members
        private const float MAX_ENERGY = 100;
        private const int ENERGY_HEIGHT = 30;

        public double X, Y;
        private Rectangle _currentRect;
        private Rectangle _outlineRect;
        private BusterTypes _busterType;

        protected BBlast _blast;
        private float _curEnergy;
        private int _energyPerShot;
        private float _regenRate;
        #endregion

        #region Constructor
        public Buster(BBlast blast, BusterTypes busterType, int energyPerShot, float regenRate)
        {
            _blast = blast;
            _busterType = busterType;
            _curEnergy = MAX_ENERGY;
            _energyPerShot = energyPerShot;
            _regenRate = regenRate;
            X = 150.0;
            Y = 10.0;

            _outlineRect = new Rectangle((int)X, (int)Y, Convert.ToInt32(MAX_ENERGY), ENERGY_HEIGHT);
            _currentRect = new Rectangle((int)X, (int)Y, Convert.ToInt32(_curEnergy), ENERGY_HEIGHT);
        }
        #endregion

        #region Public Methods/Properties

        public BusterTypes BusterType
        {
            get { return _busterType; }
        }

        public bool CanFire()
        {
            if (_curEnergy - _energyPerShot >= 0.0)
            {
                return true;
            }
            return false;
        }

        public virtual void Fire(double destX, double destY)
        {
            _curEnergy -= _energyPerShot;
            _currentRect.Width = Convert.ToInt32(_curEnergy);
        }

        public virtual void Draw(Graphics g)
        {
            g.DrawRectangle(Pens.Black, _outlineRect);
            g.FillRectangle(Brushes.Blue, _currentRect);
        }

        public virtual void Update()
        {
            _curEnergy += _regenRate;
            if (_curEnergy > MAX_ENERGY)
            {
                _curEnergy = MAX_ENERGY;
            }
            _currentRect.Width = Convert.ToInt32(_curEnergy);
        }

        #endregion
    }
    #endregion

