    #region BlackHoleBuster : Buster
    public class BlackHoleBuster : Buster
    {
        private List<BlackHole> _blackHoles = new List<BlackHole>();

        public BlackHoleBuster(BBlast blast)
            : base(blast, BusterTypes.BlackHole, 100, 3.2f)
        {
        }

        public override void Fire(double x, double y)
        {
            base.Fire(x, y);

            _blackHoles.Add(new BlackHole(_blast, x, y));
        }

        public override void Update()
        {
            base.Update();

            List<BlackHole> deadBlackHoles = new List<BlackHole>();

            foreach (BlackHole blackHole in _blackHoles)
            {
                if (blackHole.Update())
                {
                    deadBlackHoles.Add(blackHole);
                }
            }

            foreach (BlackHole deadBlackHole in deadBlackHoles)
            {
                _blackHoles.Remove(deadBlackHole);
            }
        }

        public override void Draw(Graphics g)
        {
            base.Draw(g);
        }

        public void DrawBlackHoles(Graphics g)
        {
            foreach (BlackHole blackHole in _blackHoles)
            {
                blackHole.Draw(g);
            }
        }

        #region BlackHole
        class BlackHole
        {
            public static long LIFETIME = 3400;
            public static double START_RADIUS = 15.0;
            public static double END_RADIUS = 45.0;
            public static double EXPAND_SPEED = 1.6;
            public static long PARTICLE_DELAY = 5;
            public static double PARTICLE_SPEED = 3.0;
            public static double SUCTION_RADIUS = 100.0;

            private double _x;
            private double _y;
            private double _radius;
            private long _lastParticleSpawn;
            private List<BlackHoleParticle> _particles = new List<BlackHoleParticle>();
            private BBlast _blast;
            private long _lifetime;
            private long _timeCreated;

            public BlackHole(BBlast blast, double x, double y)
            {
                _blast = blast;
                _x = x;
                _y = y;
                _radius = BlackHole.START_RADIUS;
                _timeCreated = BBUtils.CurTime();
                _lastParticleSpawn = BBUtils.CurTime();
                _lifetime = BlackHole.LIFETIME;
            }

            public double X
            {
                get { return _x; }
            }

            public double Y
            {
                get { return _y; }
            }

            /// <summary>
            /// Returns true if its lifetime has expired.
            /// </summary>
            /// <returns></returns>
            public bool Update()
            {
                if (_radius < BlackHole.END_RADIUS)
                {
                    _radius += BlackHole.EXPAND_SPEED;
                }

                //Periodically spawn more particles
                if (BBUtils.TimeSince(_lastParticleSpawn) > BlackHole.PARTICLE_DELAY &&
                    BBUtils.TimeSince(_timeCreated) < _lifetime - 600)
                {
                    _lastParticleSpawn = BBUtils.CurTime();
                    SpawnParticle();
                }

                List<BlackHoleParticle> deadParticles = new List<BlackHoleParticle>();

                foreach (BlackHoleParticle particle in _particles)
                {
                    if (!particle.IsAlive)
                    {
                        deadParticles.Add(particle);
                    }
                    else
                    {
                        particle.Move();
                    }
                }

                foreach (BlackHoleParticle deadParticle in deadParticles)
                {
                    _particles.Remove(deadParticle);
                }

                //Suck black flyers towards the black hole
                foreach (Flyer flyer in _blast.Flyers)
                {
                    double dist = BBUtils.Distance(_x, _y, flyer.X, flyer.Y);

                    if (flyer.BusterType == BusterTypes.BlackHole && dist < BlackHole.SUCTION_RADIUS)
                    {
                        double angle = BBUtils.GetAngleBetween(flyer.X, flyer.Y, _x, _y);

                        flyer.Scale = dist / BlackHole.SUCTION_RADIUS;
                        flyer.Stop();
                        flyer.X += 10.0 * Math.Cos(angle);
                        flyer.Y += 10.0 * Math.Sin(angle);

                        //When the flyer is sucked all the way in, kill it
                        if (BBUtils.Distance(_x, _y, flyer.X, flyer.Y) < 5.0)
                        {
                            flyer.Kill();
                        }
                    }
                }

                return BBUtils.TimeSince(_timeCreated) > _lifetime;
            }

            public void Draw(Graphics graphics)
            {
                foreach (BlackHoleParticle entity in _particles)
                {
                    entity.Draw(graphics);
                }
            }

            private void SpawnParticle()
            {
                for (int i = 0; i < 15; i++)
                {
                    double angle = BBUtils.RandomAngle();
                    double invAngle = angle + Math.PI;
                    double newX = _x + _radius * Math.Cos(angle);
                    double newY = _y + _radius * Math.Sin(angle);
                    double newDx = BlackHole.PARTICLE_SPEED * Math.Cos(invAngle);
                    double newDy = BlackHole.PARTICLE_SPEED * Math.Sin(invAngle);
                    int frameLifetime = Convert.ToInt32(BBUtils.Distance(newX, newY, _x, _y) / BlackHole.PARTICLE_SPEED);

                    _particles.Add(new BlackHoleParticle(this, _blast, newX, newY, newDx, newDy, 0.0, 0.0, frameLifetime));
                }
            }
        }
        #endregion

        #region BlackHoleParticle
        class BlackHoleParticle : Entity
        {
            private BlackHole _blackHole;
            private int _frameLifetime;
            private int _numFramesAlive = 0;

            public BlackHoleParticle(BlackHole blackHole, BBlast blast, double x, double y, double dx, double dy, double ax, double ay, int frameLifetime)
                : base(blast, GraphicsHolder.Instance.BlackHoleParticle, x, y, dx, dy, ax, ay)
            {
                _blackHole = blackHole;
                _frameLifetime = frameLifetime;
            }

            public override void Move()
            {
                base.Move();
                _numFramesAlive++;
            }

            public override void Draw(Graphics g)
            {
                double scale = Math.Min(1.0, BBUtils.Distance(X, Y, _blackHole.X, _blackHole.Y) / BlackHole.END_RADIUS);
                g.DrawImage(_image, (float)X, (float)Y, Convert.ToInt32(Width * scale),
                    Convert.ToInt32(Height * scale));
            }

            public new bool IsAlive
            {
                get { return _numFramesAlive < _frameLifetime; }
            }
        }
        #endregion
    }
    #endregion

    #endregion

    #region LevelDisplayer
    public class LevelDisplayer
    {
        private BBlast _blast;
        private bool _isActive;
        private float _levelY;
        private float _levelDy;
        private float _timeActive;

        public LevelDisplayer(BBlast blast)
        {
            _blast = blast;
            _isActive = true;
        }

        public void ShowNextLevel()
        {
            _isActive = true;
            _levelY = -100.0F;
            _levelDy = 400.0F;
            _timeActive = 0;
        }

        public void StartFeatureTeam()
        {
            _isActive = true;
            _levelY = -100.0F;
            _levelDy = 400.0F;
            _timeActive = 0;
        }

        public void Update(float dt)
        {
            _timeActive += dt;

            if (_levelDy > 0.0F)
            {
                _levelY += dt * _levelDy;

                if (_levelY > 150.0F)
                {
                    _levelDy -= dt * 1500.0F;
                }
            }

            if (_timeActive > 2.5)
            {
                _isActive = false;
            }
        }

        public void Draw(Graphics graphics)
        {
            if (!_isActive)
                return;
            if (_blast.State == BBlastState.LevelDisplay)
            {
                graphics.DrawString("Sprint " + (_blast.SpawnManager.CurrentLevel), BBFonts.LevelFont, Brushes.Black, 562.0F, _levelY, BBFonts.CenteredFormat);

                if (_levelDy <= 0.0)
                {
                    graphics.DrawString("Estimated Points: " + _blast.SpawnManager.BugsInLevel, BBFonts.EstimatedPointsFont, Brushes.Black, 562.0F, _levelY + 100.0F, BBFonts.CenteredFormat);
                }
            }
            else
            {
                graphics.DrawString("Feature Team Testing", BBFonts.LevelFont, Brushes.Black, 562.0F, _levelY, BBFonts.CenteredFormat);

                if (_levelDy <= 0.0)
                {
                    graphics.DrawString("Fix " + _blast.FeatureTeamBugsToFix + " bugs for QA acceptance", BBFonts.EstimatedPointsFont, Brushes.Black, 562.0F, _levelY + 100.0F, BBFonts.CenteredFormat);
                }
            }
        }

        public bool IsActive
        {
            get { return _isActive; }
        }

    }
