    #region ScoreSet
    public class ScoreSet
    {
        public Dictionary<BusterTypes, int> BugsKilled = new Dictionary<BusterTypes, int>();
        public Dictionary<BusterTypes, int> BugsMissed = new Dictionary<BusterTypes, int>();
        public Dictionary<BusterTypes, int> ShotsFired = new Dictionary<BusterTypes, int>();

        public ScoreSet()
        {
            Reset();
        }

        public void Reset()
        {
            foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
            {
                BugsKilled[type] = 0;
                BugsMissed[type] = 0;
                ShotsFired[type] = 0;
            }
        }

        public int TotalBugsKilled
        {
            get
            {
                int count = 0;
                foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
                {
                    if (type != BusterTypes.Sheltoon)
                    {
                        count += BugsKilled[type];
                    }
                }
                return count;
            }
        }

        public int TotalBugsMissed
        {
            get
            {
                int count = 0;
                foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
                {
                    if (type != BusterTypes.Sheltoon)
                    {
                        count += BugsMissed[type];
                    }
                }
                return count;
            }
        }

        public int TotalSheltoons
        {
            get { return BugsKilled[BusterTypes.Sheltoon]; }
        }

        public int TotalSheltoonsMissed
        {
            get { return BugsMissed[BusterTypes.Sheltoon]; }
        }

        public int TotalShotsFired
        {
            get
            {
                int count = 0;
                foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
                {
                    if (type != BusterTypes.Sheltoon)
                    {
                        count += ShotsFired[type];
                    }
                }
                return count;
            }
        }

        public static ScoreSet operator +(ScoreSet s1, ScoreSet s2)
        {
            ScoreSet result = new ScoreSet();

            foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
            {
                result.BugsKilled[type] = s1.BugsKilled[type] + s2.BugsKilled[type];
                result.BugsMissed[type] = s1.BugsMissed[type] + s2.BugsMissed[type];
                result.ShotsFired[type] = s1.ShotsFired[type] + s2.ShotsFired[type];
            }

            return result;
        }
    }
    #endregion

    public class ScoreCard
    {
        public static int SCORE_PER_FIXED_BUG = 100;
        public static int SCORE_PER_UNFIXED_BUG = -30;
        public static int SCORE_PER_SHELTOON = 600;
        public static int SCORE_PER_SHELTOON_MISSED = -300;
        public static int SCORE_PER_RATING = 16;
        private Dictionary<BusterTypes, double> _busterCoefficients = new Dictionary<BusterTypes, double>();

        private bool _isActive;
        private BBlast _bblast;
        private long _timeStarted;
        private int _drawY;

        private ScoreSet _currentLevelScoreSet;
        private ScoreSet _overallScoreSet;
        private int _scoreThisSprint;
        private int _totalScore = 0;
        private double _totalBBRating = 0.0;

        private int _scoreFromBugsKilled;
        private int _scoreFromBugsMissed;
        private int _scoreFromSheltoonsKilled;
        private int _scoreFromSheltoonsMissed;
        private int _scoreFromRating;
        private int _featureTeamScore;

        public ScoreCard(BBlast bblast)
        {
            _bblast = bblast;
            _currentLevelScoreSet = new ScoreSet();
            _overallScoreSet = new ScoreSet();

            _busterCoefficients[BusterTypes.Acid] = 7.0;
            _busterCoefficients[BusterTypes.BlackHole] = 7.0;
            _busterCoefficients[BusterTypes.Bubble] = 7.0;
            _busterCoefficients[BusterTypes.Snip] = 7.0;
            _busterCoefficients[BusterTypes.Star] = 5.0;
        }

        public ScoreSet CurrentScore
        {
            get { return _currentLevelScoreSet; }
        }

        public double BBRating
        {
            get
            {
                double fixPercent = (double)_currentLevelScoreSet.TotalBugsKilled / (double)(_currentLevelScoreSet.TotalBugsKilled + _currentLevelScoreSet.TotalBugsMissed);
                double sheltoonsPerAttempt = _currentLevelScoreSet.TotalSheltoons / (double)_currentLevelScoreSet.TotalShotsFired;
                double sheltoonsMissedPerAttempt = _currentLevelScoreSet.TotalSheltoonsMissed / (double)_currentLevelScoreSet.TotalShotsFired;
                double fixPerAttempt = Math.Max(3.0, GetWeightedFixPerAttempt());

                if (double.IsNaN(sheltoonsMissedPerAttempt))
                    sheltoonsMissedPerAttempt = 0.0;
                if (double.IsNaN(sheltoonsPerAttempt))
                    sheltoonsPerAttempt = 0.0;

                double C = ((fixPercent * 100.0) - 30.0) / 20.0;
                double Y = (fixPerAttempt - 3.0) * 0.25;
                double T = sheltoonsPerAttempt * 20;
                double I = 2.375 - (sheltoonsMissedPerAttempt * 25.0);

                double rating = ((C + Y + T + I) / 6.0) * 100.0;
                return double.IsNaN(rating) ? 0.0 : rating;
            }
        }

        private double GetWeightedFixPerAttempt()
        {
            double total = 0.0;
            int numCounted = 0;

            foreach (BusterTypes type in Enum.GetValues(typeof(BusterTypes)))
            {
                if (type == BusterTypes.Sheltoon)
                    continue;

                double fixPerAttempt = (double)_currentLevelScoreSet.BugsKilled[type] / (double)_currentLevelScoreSet.ShotsFired[type];
                if (!double.IsNaN(fixPerAttempt))
                {
                    total += (fixPerAttempt * _busterCoefficients[type]);
                    numCounted++;
                }
            }

            if (numCounted == 0)
                return 0.0;
            else
                return total / (double)numCounted;
        }

        public double TotalBBRating
        {
            get { return _totalBBRating; }
        }

        public int TotalScore
        {
            get { return _totalScore; }
        }

        public bool IsActive
        {
            get { return _isActive; }
            set { _isActive = value; }
        }

        public void Reset()
        {
            _currentLevelScoreSet.Reset();
            _scoreThisSprint = 0;
        }

        public void ShowScoreCard()
        {
            _isActive = true;
            _timeStarted = BBUtils.CurTime();

            if (_bblast.State == BBlastState.ScoreCard)
            {
                _scoreFromBugsKilled = _currentLevelScoreSet.TotalBugsKilled * SCORE_PER_FIXED_BUG;
                _scoreFromBugsMissed = _currentLevelScoreSet.TotalBugsMissed * SCORE_PER_UNFIXED_BUG;
                _scoreFromSheltoonsKilled = _currentLevelScoreSet.TotalSheltoons * SCORE_PER_SHELTOON;
                _scoreFromSheltoonsMissed = _currentLevelScoreSet.TotalSheltoonsMissed * SCORE_PER_SHELTOON_MISSED;
                _scoreFromRating = (int)BBRating * SCORE_PER_RATING;

                _totalBBRating = ((_totalBBRating * (double)(_bblast.SpawnManager.CurrentLevel - 1.0)) + BBRating) / (double)_bblast.SpawnManager.CurrentLevel;
                _scoreThisSprint = _scoreFromBugsKilled + _scoreFromBugsMissed + _scoreFromSheltoonsKilled + _scoreFromSheltoonsMissed + _scoreFromRating;
                _totalScore += _scoreThisSprint;
                _overallScoreSet += _currentLevelScoreSet;
            }
            else if (_bblast.State == BBlastState.FeatureTeamScore)
            {
                _featureTeamScore = (CurrentScore.TotalBugsKilled >= _bblast.FeatureTeamBugsToFix - 10)
                    ? _bblast.FeatureTeamBugsToFix * 20 : 0;
            }
        }

        public void Update(float dt)
        {
        }

        public void OnMouseClick()
        {
            if (BBUtils.CurTime() - _timeStarted > 1500)
            {
                _isActive = false;
            }
        }

        public void Draw(Graphics g)
        {
            if (_bblast.State == BBlastState.ScoreCard)
            {
                DrawScoreCard(g);
            }
            else
            {
                DrawFeatureTeamScoreCard(g);
            }

            if (BBUtils.CurTime() % 500 < 300)
                g.DrawString("Click To Continue", BBFonts.ScoreFont, Brushes.Black, 512.0f, 600.0f, BBFonts.CenteredFormat);
        }

        private void DrawFeatureTeamScoreCard(Graphics g)
        {
            _drawY = 230;
            if (BBUtils.CurTime() - _timeStarted > 100)
            {
                if (_featureTeamScore == 0)
                {
                    g.DrawString("No Time Remaining!", BBFonts.EstimatedPointsFont, Brushes.Black, 562.0f, 100.0f, BBFonts.CenteredFormat);
                    g.DrawString("QA did not accept the build.", BBFonts.EstimatedPointsFont, Brushes.Black, 562.0f, 200.0f, BBFonts.CenteredFormat);
                }
                else
                {
                    g.DrawString("QA Has Accepted The Build!", BBFonts.EstimatedPointsFont, Brushes.Black, 562.0f, 100.0f, BBFonts.CenteredFormat);
                    g.DrawString("Bonus: $" + _featureTeamScore, BBFonts.EstimatedPointsFont, Brushes.Black, 562.0f, 200.0f, BBFonts.CenteredFormat);
                }
            }
        }

        private void DrawScoreCard(Graphics g)
        {
            _drawY = 230;

            if (BBUtils.CurTime() - _timeStarted > 100)
                g.DrawString("Sprint " + _bblast.SpawnManager.CurrentLevel + " Complete!", BBFonts.LevelFont, Brushes.Black, 542.0f, 100.0f, BBFonts.CenteredFormat);
            if (BBUtils.CurTime() - _timeStarted > 200)
                g.DrawString("                   Overall                This Sprint            Raise", BBFonts.ScoreFont, Brushes.Black, 380.0f, 195.0f);
            if (BBUtils.CurTime() - _timeStarted > 300)
                DrawStat(g, "Fixed bugs:", _overallScoreSet.TotalBugsKilled, _currentLevelScoreSet.TotalBugsKilled, _scoreFromBugsKilled);
            if (BBUtils.CurTime() - _timeStarted > 400)
                DrawStat(g, "Unfixed bugs:", _overallScoreSet.TotalBugsMissed, _currentLevelScoreSet.TotalBugsMissed, _scoreFromBugsMissed);
            if (BBUtils.CurTime() - _timeStarted > 500)
                DrawStat(g, "Sheltoons dealt with:", _overallScoreSet.TotalSheltoons, _currentLevelScoreSet.TotalSheltoons, _scoreFromSheltoonsKilled);
            if (BBUtils.CurTime() - _timeStarted > 600)
                DrawStat(g, "Unhandled Sheltoons :", _overallScoreSet.TotalSheltoonsMissed, _currentLevelScoreSet.TotalSheltoonsMissed, _scoreFromSheltoonsMissed);
            if (BBUtils.CurTime() - _timeStarted > 600)
                DrawStat(g, "BB Rating :", (int)TotalBBRating, (int)BBRating, _scoreFromRating);
            if (BBUtils.CurTime() - _timeStarted > 700)
            {
                _drawY += 30;
                g.DrawString("Sprint " + _bblast.SpawnManager.CurrentLevel + " raise: ", BBFonts.ScoreFont, Brushes.Black, 245.0f, _drawY);
                DrawInt(g, _scoreThisSprint, 795, true, true);
            }
            if (BBUtils.CurTime() - _timeStarted > 800)
            {
                _drawY += 40;
                g.DrawString("Salary: ", BBFonts.ScoreFont, Brushes.Black, 245.0f, _drawY);
                DrawInt(g, _totalScore, 795, false, true);
            }
        }

        private void DrawStat(Graphics g, string stat, int overall, int thisLevel, int score)
        {
            g.DrawString(stat, BBFonts.ScoreFont, Brushes.Black, 245.0f, (float)_drawY);
            DrawInt(g, overall, 515, false, false);
            DrawInt(g, thisLevel, 665, false, false);
            DrawInt(g, score, 795, true, true);

            _drawY += 40;
        }

        private void DrawInt(Graphics g, int i, int x, bool showSign, bool showAsCurrency)
        {
            string s = i.ToString();

            Brush b = Brushes.Black;
            if (i < 0)
            {
                if (showSign) b = Brushes.Red;
                if (showAsCurrency) s = string.Format("{0:C2}", i);
            }
            if (i > 0)
            {
                if (showSign && i > 0) b = Brushes.Green;
                if (showAsCurrency) s = string.Format("{0:C2}", i);
            }
            else
            {
                if (showAsCurrency) s = string.Format("{0:C2}", i); ;
            }

            g.DrawString(s, BBFonts.ScoreFont, b, x, _drawY, BBFonts.CenteredFormat);
        }

    }
