    #region TextDisplayer
    public enum TextType
    {
        Score,
        Sheltoon
    }

    public class TextDisplayer
    {
        private static Font ScoreFont = new Font("Segoe UI", 12F, FontStyle.Regular, GraphicsUnit.Pixel);
        private static Font SheltoonFont = new Font("Segoe UI", 18F, FontStyle.Regular, GraphicsUnit.Pixel);
        private List<Text> _texts = new List<Text>();
        private BBlast _bblast;

        public TextDisplayer(BBlast blast)
        {
            _bblast = blast;
        }

        public void SpawnText(string s, double x, double y, TextType textType)
        {
            Text text = new Text();
            text.String = s;
            text.X = x;
            text.Y = y;
            text.Alpha = 255.0;
            text.Ax = 0;
            text.TimeCreated = BBUtils.CurTime();

            if (textType == TextType.Score)
            {
                text.Font = ScoreFont;
                text.Dx = BBUtils.RandomInt(-3, 3);
                text.Dy = -6;
                text.Ay = 1;
            }
            else if (textType == TextType.Sheltoon)
            {
                text.Font = SheltoonFont;
            }

            _texts.Add(text);
        }

        public void Update()
        {
            List<Text> textsToRemove = new List<Text>();

            foreach (Text text in _texts)
            {
                text.Dx += text.Ax;
                text.Dy += text.Ay;
                text.X += text.Dx;
                text.Y += text.Dy;
                text.Alpha -= 3.0;

                if (BBUtils.CurTime() - text.TimeCreated > 800 ||
                    text.X < -10 || text.X > _bblast.Width + 30 ||
                    text.Y < -10 || text.Y > _bblast.Height + 30)
                {
                    textsToRemove.Add(text);
                }
            }

            foreach (Text text in textsToRemove)
            {
                _texts.Remove(text);
            }
        }

        public void Draw(Graphics g)
        {
            foreach (Text text in _texts)
            {
                g.DrawString(text.String, text.Font, Brushes.Black, (int)text.X, (int)text.Y);
                //g.DrawString(text.String, text.Font, new SolidBrush(Color.FromArgb((int)text.Alpha, 255, 255, 255)), (int)text.X, (int)text.Y);
            }
        }

        private class Text
        {
            public long TimeCreated;
            public Font Font;
            public double Alpha;
            public string String;
            public double X;
            public double Y;
            public double Dx;
            public double Dy;
            public double Ax;
            public double Ay;
        }
    }
    #endregion

    #region SpawnManager
    public class SpawnManager
    {
        #region Variables
        // Tweakable Parameters
        private long _waveSpawnInterval = 3000;
        private long _bugSpawnInterval = 100;
        private double _bugsPerLevelMultiplier = 1.09;
        private double _bugsPerWaveMultiplier = 1.08;
        private double _bugColorsPerWaveAdder = 0.2;
        private int _bugYSpreadAdder = 25;
        private int _levelToStartSpawningSheltoon = 1;
        private double _waveSpawnMultiplier = 1.15;
        // Level Variables
        private int _currentLevel = 0;
        private double _bugsInThisLevel = 16;
        private double _bugNumberPerWave = 4;
        private int _bugsToSpawn = 0;
        private int _bugsLeftInLevel = 0;
        private int _bugColorSeed = BBUtils.RandomInt(0, 5);
        private double _bugColorsPerWave = 2.0;
        private int _bugMinSpeed = 3;
        private int _bugMaxSpeed = 5;
        // Each bugs spawn location is:
        // Rand(0, bugYSpread) + _curBaseSpawnLoc=Rand(0, lowestYSpawnLoc - bugYSpread)
        // _curBaseSpawnLoc is updated once per wave
        private int _bugYSpread = 300;
        private int _curBaseSpawnLoc = 60;
        private int _lowestYSpawnLoc = 450;
        private BBlast _bblast;
        // Timers
        private long _lastWaveTime = 0;
        private long _lastBugSpawnTime = 0;
        // State Variables
        private bool _isSpawning = false;
        #endregion

        #region Feature Team Variables
        private double _ftBugsInThisLevel = 200;
        private double _ftBugNumberPerWave = 50;
        private double _ftBugColorsPerWave = 5;
        private int _ftBugYSpread = 400;
        private long _ftBugSpawnInterval = 5;
        #endregion

        #region Constructor
        public SpawnManager(BBlast bblast)
        {
            _bblast = bblast;
            _currentLevel = 0;
            _bugsLeftInLevel = (int)_bugsInThisLevel;
        }
        #endregion

        #region Properties
        private double BugNumberPerWave
        {
            get { return _bblast.State == BBlastState.FeatureTeam ? _ftBugNumberPerWave : _bugNumberPerWave; }
        }

        private double BugColorsPerWave
        {
            get { return _bblast.State == BBlastState.FeatureTeam ? _ftBugColorsPerWave : _bugColorsPerWave; }
        }

        private int BugYSpread
        {
            get { return _bblast.State == BBlastState.FeatureTeam ? _ftBugYSpread : _bugYSpread; }
        }

        private long BugSpawnInterval
        {
            get { return _bblast.State == BBlastState.FeatureTeam ? _ftBugSpawnInterval : _bugSpawnInterval; }
        }

        public int CurrentLevel
        {
            get { return _currentLevel; }
        }

        public int BugsLeftInLevel
        {
            get { return _bugsLeftInLevel; }
            set
            {
                _bugsLeftInLevel = Math.Max(0, value);
            }
        }
        #endregion

        /// <summary>
        /// returns true if the level just ended
        /// </summary>
        /// <returns></returns>
        public void Update()
        {
            long elapsedTimeSinceLastWave = (BBUtils.CurTime() - _lastWaveTime);

            if (elapsedTimeSinceLastWave > _waveSpawnInterval && _isSpawning == false)
            {
                _isSpawning = true;
                _bugsToSpawn = (int)BugNumberPerWave;
                _curBaseSpawnLoc = BBUtils.RandomInt(0, _lowestYSpawnLoc - BugYSpread);
            }

            if (_isSpawning)
            {
                if (BBUtils.CurTime() - _lastBugSpawnTime > BugSpawnInterval)
                {
                    SpawnBug();
                    _bugsToSpawn--;
                    _lastBugSpawnTime = BBUtils.CurTime();
                    if (_bugsToSpawn == 0)
                    {
                        _isSpawning = false;
                        _lastWaveTime = BBUtils.CurTime();
                    }
                }
            }
        }

        private void SpawnBug()
        {
            Flyer flyer = null;

            if (_currentLevel >= _levelToStartSpawningSheltoon && BBUtils.RandomInt(0, 25) == 5)
            {
                flyer = new Flyer(_bblast, GraphicsHolder.Instance.Sheltoon,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.Sheltoon);
                _bblast.Flyers.Add(flyer);
                return;
            }

            int color = ((int)Math.Floor(BBUtils.RandomDouble(1, BugColorsPerWave) + _bugColorSeed)) % 5;
            switch (color)
            {
                case 0:
                    flyer = new Flyer(_bblast, GraphicsHolder.Instance.BlueBug,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.Bubble);
                    break;
                case 1:
                    flyer = new Flyer(_bblast, GraphicsHolder.Instance.BlackBug,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.BlackHole);
                    break;
                case 2:
                    flyer = new Flyer(_bblast, GraphicsHolder.Instance.GreenBug,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.Acid);
                    break;
                case 3:
                    flyer = new Flyer(_bblast, GraphicsHolder.Instance.RedBug,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.Snip);
                    break;
                default:
                    flyer = new Flyer(_bblast, GraphicsHolder.Instance.YellowBug,
                            _bblast.Width, BBUtils.RandomInt(0, BugYSpread) + _curBaseSpawnLoc,
                            -BBUtils.RandomInt(_bugMinSpeed, _bugMaxSpeed), 0,
                            0, 0, BusterTypes.Star);
                    break;
            }

            _bblast.Flyers.Add(flyer);
        }

        public void StartNextLevel()
        {
            // Set level variables
            _currentLevel++;
            _bugsInThisLevel = (double)_bugsInThisLevel * _bugsPerLevelMultiplier;
            _bugsLeftInLevel = (int)_bugsInThisLevel;
            _bugNumberPerWave = (double)_bugNumberPerWave * _bugsPerWaveMultiplier;
            _bugColorsPerWave = Math.Min(5, _bugColorsPerWave + _bugColorsPerWaveAdder);
            _bugYSpread = Math.Min(_lowestYSpawnLoc, _bugYSpread + _bugYSpreadAdder);
            _waveSpawnInterval *= (long)_waveSpawnMultiplier;
            _isSpawning = false;
        }

        public void StartFeatureTeam()
        {
            // Set level variables
            _bugsLeftInLevel = (int)_ftBugsInThisLevel;
            _isSpawning = false;
        }

        public int BugsInLevel
        {
            get { return (int)_bugsInThisLevel; }
        }

    }
    #endregion

    #region BusterSelector
    class BusterSelector
    {
        private List<BusterOption> _busterOptions = new List<BusterOption>();
        private BusterTypes _selectedBuster;

        public static int NUM_BUSTER_TYPES = 5;
        public static int CENTER_X = 890;
        public static int CENTER_Y = 40;
        public static int MAJOR_AXIS = 55;
        public static int MINOR_AXIS = 15;
        public static double SCROLL_SPEED = 0.38;

        public BusterSelector()
        {
            for (int i = 0; i < NUM_BUSTER_TYPES; i++)
            {
                _busterOptions.Add(new BusterOption((BusterTypes)i));
            }
        }

        public BusterTypes SelectedBuster
        {
            get { return _selectedBuster; }
            set
            {
                if (_busterOptions[0].IsScrolling)
                    return;

                int cur = (int)value;
                if (cur >= NUM_BUSTER_TYPES)
                    cur = 0;

                int difference = (int)_selectedBuster - cur;
                if (difference == 0) return;

                _selectedBuster = (BusterTypes)cur;

                foreach (BusterOption option in _busterOptions)
                {
                    option.TargetAngle -= ((Math.PI * 2.0 * difference) / NUM_BUSTER_TYPES);
                }
            }
        }

        public void ScrollRight()
        {
            if (_busterOptions[0].IsScrolling)
                return;

            int cur = (int)_selectedBuster;
            cur++;
            if (cur >= NUM_BUSTER_TYPES)
                cur = 0;
            _selectedBuster = (BusterTypes)cur;

            foreach (BusterOption option in _busterOptions)
            {
                option.TargetAngle -= ((Math.PI * 2.0) / NUM_BUSTER_TYPES);
            }
        }

        public void ScrollLeft()
        {
            if (_busterOptions[0].IsScrolling)
                return;

            int cur = (int)_selectedBuster;
            cur--;
            if (cur < 0)
                cur = NUM_BUSTER_TYPES - 1;
            _selectedBuster = (BusterTypes)cur;

            foreach (BusterOption option in _busterOptions)
            {
                option.TargetAngle += ((Math.PI * 2.0) / NUM_BUSTER_TYPES);
            }
        }

        public void Update()
        {
            foreach (BusterOption option in _busterOptions)
            {
                option.Update();
            }
        }

        public void Draw(Graphics g)
        {
            _busterOptions.Sort(new Comparison<BusterOption>(CompareBusterOptions));

            foreach (BusterOption o in _busterOptions)
            {
                o.Draw(g);
            }
        }

        /// <summary>
        /// Sorts the buster options by draw order
        /// </summary>
        private int CompareBusterOptions(BusterOption o1, BusterOption o2)
        {
            return o1.Y - o2.Y;
        }

        private class BusterOption
        {
            private BusterTypes _busterType;
            private int _x;
            private int _y;
            private double _angle;
            private double _targetAngle;

            public int X
            {
                get { return _x; }
            }

            public int Y
            {
                get { return _y; }
            }

            public double TargetAngle
            {
                set { _targetAngle = value; }
                get { return _targetAngle; }
            }

            public double Angle
            {
                get { return _angle; }
                set
                {
                    _angle = value;
                    _targetAngle = value;
                }
            }

            public bool IsScrolling
            {
                get { return _targetAngle != _angle; }
            }

            public BusterOption(BusterTypes busterType)
            {
                _busterType = busterType;
                Angle = (Math.PI / 2.0) + (int)busterType * ((2.0 * Math.PI) / BusterSelector.NUM_BUSTER_TYPES);
                SetPos();
            }

            public void Update()
            {
                if (_angle < _targetAngle)
                {
                    _angle += BusterSelector.SCROLL_SPEED;
                    if (_angle > _targetAngle)
                        _angle = _targetAngle;
                }
                else if (_angle > _targetAngle)
                {
                    _angle -= BusterSelector.SCROLL_SPEED;
                    if (_angle < _targetAngle)
                        _angle = _targetAngle;
                }

                SetPos();
            }

            public void Draw(Graphics g)
            {
                Bitmap graphic = null;
                switch (_busterType)
                {
                    case BusterTypes.Star:
                        graphic = GraphicsHolder.Instance.YellowBuster;
                        break;
                    case BusterTypes.Snip:
                        graphic = GraphicsHolder.Instance.RedBuster;
                        break;
                    case BusterTypes.Bubble:
                        graphic = GraphicsHolder.Instance.BlueBuster;
                        break;
                    case BusterTypes.Acid:
                        graphic = GraphicsHolder.Instance.GreenBuster;
                        break;
                    case BusterTypes.BlackHole:
                        graphic = GraphicsHolder.Instance.BlackBuster;
                        break;
                    default:
                        throw new Exception("Invalid BusterType in BusterOption.Draw()");
                }

                int selectorRadius = (BusterSelector.MINOR_AXIS * 2);
                int yOffset = (BusterSelector.CENTER_Y + BusterSelector.MINOR_AXIS) - _y;
                double scale = 0.6 + (0.4 * ((double)(selectorRadius - yOffset) / (double)selectorRadius));
                int width = Convert.ToInt32(graphic.Width * scale);
                int height = Convert.ToInt32(graphic.Height * scale);

                g.DrawImage(graphic, _x - width / 2, _y - height / 2, width, height);
            }

            private void SetPos()
            {
                _x = BusterSelector.CENTER_X + Convert.ToInt32(BusterSelector.MAJOR_AXIS * Math.Cos(_angle));
                _y = BusterSelector.CENTER_Y + Convert.ToInt32(BusterSelector.MINOR_AXIS * Math.Sin(_angle));
            }
        }
    }
