        /// <summary>
        /// Creates an empty (transparent bitmap with the given dimensions.
        /// </summary>
        /// <param name="height"></param>
        /// <param name="width"></param>
        /// <returns></returns>
        public Bitmap CreateEmptyBitmap(int width, int height)
        {
            Bitmap bm = new Bitmap(width, height);

            for (int i = 0; i < width; i++)
            {
                for (int j = 0; j < height; j++)
                {
                    bm.SetPixel(i, j, BBColors.Transparent);
                }
            }

            return bm;
        }

        #endregion

        #region Properties

        public static GraphicsHolder Instance
        {
            get
            {
                if (_instance == null)
                {
                    _instance = new GraphicsHolder();
                }
                return _instance;
            }
        }

        #endregion

        #region Helper Methods

        private Bitmap BuildBitmap(string s)
        {
            _string = s;
            _index = 0;

            int width = NextInt();
            int height = NextInt();

            Bitmap bitmap = new Bitmap(width, height);
            int pixel = 0;

            while (pixel < width * height)
            {
                int x = pixel % width;
                int y = (pixel - x) / width;
                bitmap.SetPixel(x, y, NextColor());
                pixel++;
            }

            return bitmap;
        }

        private Color NextColor()
        {
            switch (_string[_index])
            {
                case 'T':
                    _index++;
                    return Color.FromArgb(0, 0, 0, 0);
                case 'B':
                    _index++;
                    return Color.FromArgb(255, 0, 0, 0);
                case 'W':
                    _index++;
                    return Color.FromArgb(255, 255, 255, 255);
                default:
                    return Color.FromArgb(NextInt(), NextInt(), NextInt(), NextInt());
            }
        }

        private int NextInt()
        {
            string s = Convert.ToString(_string[_index]) +
                Convert.ToString(_string[_index + 1]) +
                Convert.ToString(_string[_index + 2]);
            _index += 3;
            return Convert.ToInt32(s);
        }

