    #region BBUtils
    public class BBUtils
    {
        private static Random _r = new Random();

        /// <summary>
        /// Returns a random angle from 0 to 2PI
        /// </summary>
        /// <returns></returns>
        public static double RandomAngle()
        {
            return (double)(_r.Next(0, Convert.ToInt32(2.0 * Math.PI * 100000.0))) / 100000.0;
        }

        public static Bitmap CloneBitmap(Bitmap bm)
        {
            Rectangle r = new Rectangle(0, 0, bm.Width, bm.Height);
            return bm.Clone(r, System.Drawing.Imaging.PixelFormat.DontCare);
        }

        public static int RandomInt(int min, int max)
        {
            return _r.Next(min, max);
        }

        public static double RandomDouble(double min, double max)
        {
            int r = _r.Next(Convert.ToInt32(min * 10000000), Convert.ToInt32(max * 10000000));

            return (double)r / 10000000;
        }

        public static double GetAngleBetween(double x1, double y1, double x2, double y2)
        {
            double angle;

            if (x1 == x2)
            {
                if (y1 > y2)
                {
                    angle = 3.0 * Math.PI / 2.0;
                }
                else
                {
                    angle = Math.PI / 2.0;
                }
            }
            else
            {
                angle = Math.Atan((y2 - y1) / (x2 - x1));
                if (x1 - x2 > 0) angle += Math.PI;
            }

            return angle;
        }

        /// <summary>
        /// Returns the current time in milliseconds
        /// </summary>
        /// <returns></returns>
        public static long CurTime()
        {
            return DateTime.Now.TimeOfDay.Ticks / 10000;
        }

        /// <summary>
        /// Returns the time in milliseconds since the given time.
        /// </summary>
        /// <param name="time"></param>
        /// <returns></returns>
        public static long TimeSince(long time)
        {
            return CurTime() - time;
        }

        /// <summary>
        /// Returns the distance between two points.
        /// </summary>
        public static double Distance(double x1, double y1, double x2, double y2)
        {
            if (x1 == x2)
                return y1 - y2;

            if (y1 == y2)
                return x1 - x2;

            return Convert.ToInt32(Math.Sqrt((x2 - x1) * (x2 - x1) + (y2 - y1) * (y2 - y1)));
        }

        /// <summary>
        /// Returns the number of milliseconds required to travel the given number of pixels
        /// at the given velocity.
        /// </summary>
        /// <param name="distance"></param>
        /// <param name="vel"></param>
        /// <returns></returns>
        public static long TimeToTravel(int distance, int vel)
        {
            double distPerMillisecond = (double)(BBlast.FPS * vel) / 1000.0;
            return Convert.ToInt64((double)distance / distPerMillisecond);
        }
    }
